import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "../style.css";
import Image from "./assets/login-img.jpg";

function Login() {
  return (
    <div className="App">
      
      <div className="background">
        <img src={Image} height="100%" width="100%"/>
      </div>

    </div>
  );
}

export default Login;
